import React from 'react';
import { auth } from '../../firebase';
import './signoutbutton.css';

const SignOutButton = () => 
	<div className="sign-out-btn">
		<button className="nav-link " type="button" onClick={auth.doSignOut}> 
			Sign Out
		</button>
	</div>

export default SignOutButton;
